 @allenharper2928  actually no, we don't have Olive Garden in italy and most italians don't even know what Olive Garden is.
the number of American fast-food franchises you can find here is quite limited: Mc, Burger king are slowly spreading, but you won't easily find a Pizza Hut or KFC except in the biggest,  more touristy cities like Rome or Milan. 
Taco Bell and other "lesser", on the other hand, don't have a single restaurant in the whole country. Make of that what you will.

